import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with increased timeout
    await page.goto(fileUrl, { timeout: 60000 });
    await page.waitForLoadState('networkidle', { timeout: 60000 });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on Electronics category using text selector
    await page.waitForSelector('text=Electronics', { timeout: 10000 });
    await page.click('text=Electronics');

    // Wait for navigation to complete
    await page.waitForTimeout(2000);

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_electronics_category.png'));

    // Verify we're on Electronics category by checking for electronics content
    const electronicsContent = await page.textContent('body');
    const hasElectronics = electronicsContent.includes('Electronics') || electronicsContent.includes('electronics');

    return {
      success: true,
      action: "Successfully navigated to Electronics category",
      extractedData: {
        hasElectronicsContent: hasElectronics,
        pageTitle: await page.title()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Electronics category",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
